import React, { Component } from 'react';
import Table from 'react-bootstrap/Table';
import moment from 'moment';

class Job extends Component {
    // Initialization
    constructor(props) {
        super(props);
        this.state = {
            detail: this.props.detail
        }
    }

    render() {
        const { detail } = this.state;
        if(detail) {
            return (
                    <div></div>
            )
        }
    }
}

export default Job;
